function handleFirstInteraction(event) {
  //  console.log("First user interaction detected:", event.type);

  // Remove the event listeners after the first interaction
  document.removeEventListener("click", handleFirstInteraction);
  document.removeEventListener("keydown", handleFirstInteraction);
  document.removeEventListener("touchstart", handleFirstInteraction);

  var bgMusic = document.getElementById("bgMusic");
  bgMusic.volume = 0.5; // Set volume to 50%
  bgMusic.play();

  var rocketEngine = document.getElementById("rocketEngine");
  rocketEngine.volume = 0.05; // Set volume to 5%
  rocketEngine.play();
}

// Add event listeners for various user interactions
document.addEventListener("click", handleFirstInteraction);
document.addEventListener("keydown", handleFirstInteraction);
document.addEventListener("touchstart", handleFirstInteraction);

var planeAudio = new Audio("./assets/audio/rocketEngine.mp3");

var explosionAudio = new Audio("./assets/audio/explode.mp3");

  var isMuted = localStorage.getItem('isMuted') === 'true';
  


  function updateMuteButton() {
        if (isMuted) {
                $('.muteBtn').text('ðŸ”‡');
                bgMusic.pause();
                rocketEngine.pause();
                explosionAudio.volume=0.0;
        } else {
                   $('.muteBtn').text('ðŸ”Š');
                   bgMusic.play();
                rocketEngine.play();
                explosionAudio.volume=0.7;
            }
   }


   $(document).on('keydown', function (e) {
    if (e.key === 'm') {
        isMuted = !isMuted;
        localStorage.setItem('isMuted', isMuted);
        updateMuteButton();
    }

    
});

$('.muteBtn').on('click', function () {
  isMuted = !isMuted;
  localStorage.setItem('isMuted', isMuted);
  updateMuteButton();
});

