$(document).ready(function () {
  var planeSpeed = 2; // Adjust speed as needed
  var obstacleSpeed = 4; // Speed of obstacles
  var obstacleInterval = 1000; // Interval for generating obstacles (in milliseconds)
  var keysPressed = {}; // Track which keys are pressed
  var $plane = $(".playerContainer");
  var $obstacleContainer = $(".obstacleContainer");
  var planeCollusionArea = $(".planeCollusionArea");

  var score = 0;
  var highestScore = localStorage.getItem("highestScore") || 0; // Fetch highest score from local storage

  $(".score").text("Score: 0"); // Initialize score display
  $(".highestScore").text("Highest Score: " + highestScore); // Display highest score

  var gameInterval = setInterval(function () {
    score++; // Increment score every second
    $(".score").text("Score:" + score); // Update score display
    obstacleSpeed = obstacleSpeed + 0.5;
    planeSpeed = planeSpeed + 0.1;
  }, 1000);

  // Add CSS for smooth transitions
  $plane.css({
    transition: "transform 0.2s",
  });

  // Track keydown and keyup events
  $(document)
    .on("keydown", function (e) {
      keysPressed[e.key] = true;
    })
    .on("keyup", function (e) {
      delete keysPressed[e.key];
    });

  // Function to move the plane
  function movePlane() {
    var top = parseInt($plane.css("top"));
    var left = parseInt($plane.css("left"));

    if ("ArrowUp" in keysPressed && "ArrowRight" in keysPressed) {
      $plane.css({
        top: Math.max(0, top - planeSpeed) + "px",
        left:
          Math.min($(window).width() - $plane.width(), left + planeSpeed) +
          "px",
        transform: "rotate(-20deg)",
      });
      planeAudio.volume = 0.1;
    } else if ("ArrowUp" in keysPressed && "ArrowLeft" in keysPressed) {
      $plane.css({
        top: Math.max(0, top - planeSpeed) + "px",
        left: Math.max(0, left - planeSpeed) + "px",
        transform: "rotate(-20deg)",
      });
      planeAudio.volume = 0.02;
    } else if ("ArrowDown" in keysPressed && "ArrowRight" in keysPressed) {
      $plane.css({
        top:
          Math.min($(window).height() - $plane.height(), top + planeSpeed) +
          "px",
        left:
          Math.min($(window).width() - $plane.width(), left + planeSpeed) +
          "px",
        transform: "rotate(20deg)",
      });
      planeAudio.volume = 0.1;
    } else if ("ArrowDown" in keysPressed && "ArrowLeft" in keysPressed) {
      $plane.css({
        top:
          Math.min($(window).height() - $plane.height(), top + planeSpeed) +
          "px",
        left: Math.max(0, left - planeSpeed) + "px",
        transform: "rotate(-20deg)",
      });
      planeAudio.volume = 0.02;
    } else if ("ArrowUp" in keysPressed) {
      $plane.css({
        top: Math.max(0, top - planeSpeed) + "px",
        transform: "rotate(-20deg)",
      });
    } else if ("ArrowDown" in keysPressed) {
      $plane.css({
        top:
          Math.min($(window).height() - $plane.height(), top + planeSpeed) +
          "px",
        transform: "rotate(20deg)",
      });
    } else if ("ArrowLeft" in keysPressed) {
      $plane.css({
        left: Math.max(0, left - planeSpeed) + "px",
        transform: "rotate(-20deg)",
      });
      planeAudio.volume = 0.02;
    } else if ("ArrowRight" in keysPressed) {
      $plane.css(
        "left",
        Math.min($(window).width() - $plane.width(), left + planeSpeed) + "px"
      );
      planeAudio.volume = 0.1;
    }
  }

  // Call movePlane function in an interval for smooth movement
  setInterval(movePlane, 3);

  // Function to generate random obstacles
  function generateObstacle() {
    var obstacleHeight = Math.floor(Math.random() * 100) + 50; // Random height for the obstacle
    var $obstacle = $('<div class="obstacle"></div>')
      .css({
        width: "200px", // Adjust width as needed
        height: "200px",
        "background-color": "rgba(255, 0, 0, 0.0)", // Replace with your obstacle Lottie animation or image
        position: "absolute",
        right: "-200px",
        top:
          Math.floor(Math.random() * ($(window).height() - obstacleHeight)) +
          "px",
      })
      .appendTo($obstacleContainer);

    // Load and play the Lottie animation for the obstacle
    var obstacleAnimation = lottie.loadAnimation({
      container: $obstacle[0],
      renderer: "svg",
      loop: true,
      autoplay: true,
      animationData: window["bird" + (Math.floor(Math.random() * 2) + 1)], // bird 1 or 2
    });

    var obstacleMove = setInterval(function () {
      var obstacleLeft = parseInt($obstacle.css("left"));
      $obstacle.css("left", obstacleLeft - obstacleSpeed + "px");

      if (obstacleLeft < -50) {
        // Remove obstacle when it goes out of screen
        $obstacle.remove();
        clearInterval(obstacleMove);
      }

      // Check for collision with plane
      var planeRect = planeCollusionArea[0].getBoundingClientRect();
      var obstacleRect = $obstacle[0].getBoundingClientRect();

      if (
        planeRect.top < obstacleRect.bottom - 100 &&
        planeRect.bottom > obstacleRect.top + 100 &&
        planeRect.left < obstacleRect.right - 30 &&
        planeRect.right > obstacleRect.left + 30
      ) {
        // Collision detected, perform actions here
        console.log("Collision detected!");
        clearInterval(obstacleMove);
        clearInterval(gameInterval);
        $obstacle.remove();
        $(".playerContainer").remove(); // Remove playerContainer
        $(".explosion").css({
          top: planeRect.top - 50 + "px",
          left: planeRect.left - 50 + "px",
          display: "block",
        });

        explosionAudio.play();

        var explosionAnimation = lottie.loadAnimation({
          container: document.querySelector(".explosion"),
          renderer: "svg",
          loop: false,
          autoplay: true,
          animationData: explosion, // Path to your explosion.json Lottie animation file
        });
        explosionAnimation.addEventListener("complete", function () {
          $(".explosion").css("display", "none");
        });

        if (score > highestScore) {
          highestScore = score; // Update highest score
          localStorage.setItem("highestScore", highestScore); // Save highest score to local storage
          $(".highestScore").text("Highest Score: " + highestScore); // Update highest score display
        }

        planeAudio.pause();

        setTimeout(function () {
          $(".gameOverDiv").css("display", "flex");
        }, 1000);

        // Display the current score in the "Your Score" div
        $(".yourScore").text("Your Score: " + score);
      }
    }, 20);
  }

  // Generate obstacles at intervals
  setInterval(generateObstacle, obstacleInterval);
});

$(document).on("keydown", function (e) {
  if (e.key === " " || e.key === "Spacebar") {
    location.reload(); // Reload the page
  }
});

// Reset tilt when arrow keys are released
$(document).on("keyup", function (e) {
  planeAudio.volume = 0.05;

  if (e.key === "ArrowUp" || e.key === "ArrowDown" || e.key === "ArrowLeft") {
    $(".playerContainer").css("transform", "rotate(0deg)");
  }
});

